"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F10329126\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Berotec (AR, AT, AU, BE, BR, CH, CZ, DE, DK, ES, FI, FR, GB, HR, HU, IE, LU, NL, NO, PL, PT, SE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F10329127\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Beta2 Agonist",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F10329164\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Bronchodilator used for symptomatic relief of asthma and other conditions such as chronic bronchitis or emphysema",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F10329166\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adults: Bronchospasm:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Metered-dose inhaler: 1 or 2 inhalations up to 3-4 times/day as needed; maximum dose: 8 inhalations/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Solution for nebulization: 0.5-1 mg every 6 hours as needed; in refractory cases, up to 2.5 mg every 6 hours as needed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Oral: 2.5-5 mg 3 times/day; maximum daily dose: 15 mg",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821250\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries; not currently available in the U.S.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F10329167\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Aerosol for inhalation: 100 mcg/inhalation (10 mL)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Solution for inhalation: 0.1% (20 mL, 50 mL)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Tablet: 2.5 mg",
"    </p>",
