"   <div class=\"block pha drugH1Div\" id=\"F192723\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Binds to opioid receptors in the CNS, causing inhibition of ascending pain pathways, altering the perception of and response to pain; produces generalized CNS depression",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F192744\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Analgesic: Oral, SubQ: 10-15 minutes; I.V.: ~5 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Peak effect: SubQ.: ~1 hour; Oral: 2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: Oral, SubQ.: 2-4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: I.M.: Erratic and highly variable",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 65% to 75%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic; hydrolyzed to meperidinic acid (inactive) or undergoes N-demethylation to normeperidine (active; has",
"     <sup>",
"      1",
"     </sup>",
"     /",
"     <sub>",
"      2",
"     </sub>",
"     the analgesic effect and 2-3 times the CNS effects of meperidine)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: ~50% to 60%; increased with liver disease",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Parent drug: Terminal phase: Adults: 2.5-4 hours, Liver disease: 7-11 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Normeperidine (active metabolite): 15-30 hours; can accumulate with high doses (&gt;600 mg/day) or with decreased renal function",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-right:0em;margin-top:0em;text-align:justify;\">",
"     Excretion: Urine (as metabolites)",
"    </p>",
"   </div>",
